import { Image } from "./image";
import {ReactComponent as Background} from '../assets/Icon exports/background-sqare.svg';
import {ReactComponent as Background2} from '../assets/Icon exports/background-rombus.svg';
import {ReactComponent as Healthcare} from '../assets/Icon exports/healthcare.svg';
import {ReactComponent as Finance} from '../assets/Icon exports/finance.svg';
import {ReactComponent as Retail} from '../assets/Icon exports/cart.svg';
import {ReactComponent as Education} from '../assets/Icon exports/education.svg';
import {ReactComponent as Automobile} from '../assets/Icon exports/Car.svg';
import {ReactComponent as FoodandAgri} from '../assets/Icon exports/Food agri icon.svg';

export const Services = (props) => {
  return (
    <div id='services' className='text-center'>
      <div className='container'>
        
        <div className='row'>
        
       <div className = 'col-services-clients-blocks'>
       <div className='section-title'>
        <h2>Our Premium Clients</h2>
        </div>
       {props.data
              ? props.data.map((d, i) => (
                <div key={`${d.title}-${i}`} className='col-sm-6 col-md-4 col-lg-4'>
                  <Image  largeImage={d.largeImage} smallImage={d.smallImage}  />
                  
                </div>
              ))
              : 'Loading...'}
          
           </div>

        </div>
      </div>
    </div>
  )
}
